52.3666 195.718C64.9897 190.229 77.9972 184.568 86.1989 172.928C101.769 150.757 84.6398 130.21 69.5177 111.991C67.1469 109.129 64.8829 106.438 62.8111 103.768C56.1258 95.2247 49.6754 87.6423 43.46 80.2735C26.8643 60.7943 12.5539 43.9636 0.422119 16.9021L2.36576 16.0264C14.3694 42.8103 28.5943 59.5342 45.0833 78.8852C51.3201 86.2326 57.7704 93.8364 64.4984 102.38C66.6343 105.007 68.7702 107.698 71.1624 110.539C85.9853 128.373 104.439 150.565 87.9503 174.06C79.4068 186.192 66.1217 192.001 53.221 197.555C35.7068 205.18 19.1751 212.356 14.4975 234.313C8.73067 261.417 20.2217 299.756 30.3458 333.589C35.9631 352.363 41.2601 370.091 43.5455 385.02C46.194 402.278 49.0347 409.476 54.7375 423.829C55.9578 426.713 57.3855 429.504 59.0092 432.181C62.1062 437.969 65.1392 443.309 65.0751 452.578Z\" stroke=\"url(#grad1)\"/>\r\n</svg>\r\n');

