INSERT INTO `lessons` (`id_lesson`, `parent_module`, `lesson_title`, `lesson_content`) VALUES
(4, 4, 'Что такое веб-дизайн?', '<p><strong>Веб-дизайн</strong> - это искусство создания пользовательских интерфейсов для веб-сайтов. Веб-дизайн не только определяет внешний вид сайта, но и влияет на его функциональность и пользовательский опыт. Стремление к привлекательному и интуитивно понятному дизайну является ключевым аспектом веб-разработки.</p>\n<p>Веб-дизайн имеет огромное значение в современном мире интернета. Качественный дизайн способен привлечь внимание пользователей, сделать сайт запоминающимся и удобным в использовании. Он помогает создать позитивное впечатление о бренде или компании, улучшает взаимодействие с посетителями и повышает конверсию.</p>\n<p>Основные принципы веб-дизайна включают в себя:</p>\n<ul>\n<li>Цвет: выбор цветовой палитры влияет на атмосферу сайта и передаваемые эмоции.</li>\n<li>Композиция: расположение элементов на странице должно быть логичным и удобным для пользователя.</li>\n<li>Типографика: правильный выбор шрифтов и их комбинаций обеспечивает читаемость и эстетическое восприятие контента.</li>\n<li>Навигация: легкость перемещения по сайту помогает пользователям быстро находить нужную информацию.</li>\n<li>Графика и мультимедиа: использование изображений, видео и анимации делает сайт более привлекательным и интерактивным.</li>\n</ul>\n<p><br />Для создания качественного веб-дизайна необходимо владеть соответствующими инструментами и технологиями. Среди них:</p>\n<ul>\n<li><br />Графические редакторы: Photoshop, Sketch, Figma - позволяют создавать дизайн-макеты и элементы интерфейса.</li>\n<li>Программы для создания макетов: Adobe XD, Sketch, Figma - помогают разрабатывать прототипы сайтов для тестирования пользовательского опыта.</li>\n<li>Инструменты для анимации и прототипирования: Principle, Adobe After Effects, InVision - используются для создания анимированных прототипов и интерактивных элементов.</li>\n</ul>\n<p><br />Одним из ключевых аспектов веб-дизайна является понимание основных технологий, на которых строится веб-сайт. Это HTML, CSS и JavaScript. HTML отвечает за структуру содержимого страницы, CSS определяет ее внешний вид, а JavaScript добавляет интерактивность и динамичность.</p>\n<p>В следующих уроках мы более подробно рассмотрим каждый из этих аспектов веб-дизайна и приступим к созданию собственных проектов. Не забывайте, что веб-дизайн - это не только техника, но и искусство, поэтому давайте вместе развиваться и творить!</p>'),
(5, 4, 'Основные принципы', '<p><strong>Принципы визуального дизайна:</strong></p>\n<ul>\n<li>Баланс: Элементы на странице должны быть равномерно распределены, чтобы создать ощущение стабильности и гармонии.</li>\n<li>Контраст: Использование контрастных цветов и элементов помогает выделить важную информацию и обеспечить хорошую читаемость.</li>\n<li>Выравнивание: Элементы должны быть выровнены по горизонтали и вертикали для создания порядка и удобства восприятия.</li>\n<li>Повторение: Повторяющиеся элементы и стили создают целостный образ и поддерживают единство дизайна.</li>\n</ul>\n<p><strong>Принципы функциональной читаемости:</strong></p>\n<ul>\n<li>Четкость: Текст и изображения должны быть четкими и понятными для пользователя.</li>\n<li>Наглядность: Использование понятных и узнаваемых символов и иконок облегчает восприятие информации.</li>\n<li>Доступность: Дизайн должен быть доступен для всех пользователей, включая людей с ограниченными возможностями.</li>\n</ul>\n<p><br /><strong>Адаптивный и отзывчивый дизайн:</strong></p>\n<ul>\n<li>Адаптивный дизайн: Сайт должен адаптироваться под разные типы устройств и разрешения экранов, чтобы обеспечить оптимальный пользовательский опыт.</li>\n<li>Отзывчивый дизайн: Элементы интерфейса должны реагировать на действия пользователя, обеспечивая быструю и понятную обратную связь.</li>\n</ul>\n<p><br /><strong>Принципы удобства использования:</strong></p>\n<ul>\n<li>Простота: Дизайн должен быть интуитивно понятным и легким в использовании для пользователя.</li>\n<li>Понятность: Информация и функциональность сайта должны быть понятными и легко доступными для пользователя.</li>\n<li>Предсказуемость: Поведение элементов интерфейса должно быть предсказуемым, чтобы пользователи могли легко понять, какие действия приведут к нужному результату.</li>\n</ul>\n<p><br />Эти принципы являются основой успешного дизайна интерфейсов, помогая создать эффективные, привлекательные и удобные веб-сайты для пользователей.</p>'),
